import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import FormatListBulletedAddIcon from '@mui/icons-material/FormatListBulletedAdd';
import FormatListBulletedIcon from '@mui/icons-material/FormatListBulleted';
import ShareIcon from '@mui/icons-material/Share';
import ChecklistRtlIcon from '@mui/icons-material/ChecklistRtl';
import BuildIcon from '@mui/icons-material/Build';
import LogoutIcon from '@mui/icons-material/Logout';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu';
import ChevronLeftIcon from '@mui/icons-material/ChevronLeft';

function DashBoard() {
  const navigate = useNavigate();
  const [value, setValue] = useState('1');
  const [open, setOpen] = useState(true);
  const logout = () => {
    localStorage.removeItem('access');
    localStorage.removeItem('refresh');
    navigate('/');
  };
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  const toggleSidebar = () => {
    setOpen(!open);
  };

  return (
    <div className=" bg-slate-200 min-h-screen text-black flex">
      <TabContext value={value}>
        <Box sx={{ display: 'flex', width: '100%' }}>
          <Box sx={{ width: open ? 100 : 0, overflow: 'hidden', transition: 'width 0.3s ease', borderRight: open ? 1 : 0, borderColor: 'divider', display: 'flex', flexDirection: 'column', alignItems: 'center', backgroundColor: '#080808', py: 2, minHeight: '100vh', gap: 2 }}>
            {open && <button className="mt-auto px-4 py-2 rounded hover:bg-blue-500" title="Account"><AccountCircleIcon sx={{ fontSize: 35, color: 'whitesmoke' }} /></button>}
            {open && <div className='py-7'></div>}
            {open &&
              <TabList orientation="vertical" onChange={handleChange} aria-label="Vertical icon tabs" sx={{ '& .MuiTab-root': { minWidth: 0, padding: '12px', color: 'white' }, '& .Mui-selected': { color: '#6495ED' } }}>
                <Tab icon={<FormatListBulletedIcon sx={{ fontSize: 35 }} />} value="1" />
                <div className='py-7'></div>
                <Tab icon={<FormatListBulletedAddIcon sx={{ fontSize: 35 }} />} value="2" />
                <div className='py-7'></div>
                <Tab icon={<ShareIcon sx={{ fontSize: 35 }} />} value="3" />
                <div className='py-7'></div>
                <Tab icon={<ChecklistRtlIcon sx={{ fontSize: 35 }} />} value="4" />
                <div className='py-7'></div>
                <Tab icon={<BuildIcon sx={{ fontSize: 35 }} />} value="5" />
              </TabList>
            }
            <Box sx={{ flexGrow: 1 }} />
            {open &&
              <button onClick={logout} className="mt-auto mb-16 px-4 py-2 bg-blue-600 rounded hover:bg-red-500" title="Logout">
                <LogoutIcon sx={{ fontSize: 35 }} />
              </button>
            }
            <button onClick={toggleSidebar} className="mb-4 text-white hover:text-blue-400">{open ? <ChevronLeftIcon /> : <MenuIcon />}</button>
          </Box>
          <Box sx={{ flexGrow: 1, p: 4 }}>
            <TabPanel value="1">Contenuto elenco</TabPanel>
            <TabPanel value="2">Contenuto aggiunta</TabPanel>
            <TabPanel value="3">Contenuto condivisione</TabPanel>
            <TabPanel value="4">Contenuto checklist</TabPanel>
            <TabPanel value="5">Contenuto impostazioni</TabPanel>
          </Box>
        </Box>
      </TabContext>
    </div>
  );
}

export default DashBoard;
